  true,\n\t\"url\": null,\n\t\"notes\": \"<p>2001 to 2013.  The National (Nationwide)
  Inpatient Sample (NIS) is part of a family of databases and software tools developed
  for the Healthcare Cost and Utilization Project (HCUP). The NIS is the largest publicly
  available all-payer inpatient health care database in the United States, yielding
  national estimates of hospital inpatient stays. Unweighted, it contains data from
  more than 7 million hospital stays each year. Weighted, it estimates more than 35
  million hospitalizations nationally. Indicators from this data source have been
  computed by personnel in CDC's Division for Heart Disease and Stroke Prevention
  (DHDSP). This dataset is one of the datasets provided by National Cardiovascular
  Disease Surveillance System. The system is designed to integrate multiple indicators
  from many data sources to provide a comprehensive picture of the public health burden
  of CVDs and associated risk factors in the United States. The data are organized
  by location (national, state, county, and selected sites) and indicator, and they
  include CVDs (e.g., heart failure). The data can be plotted as trends and stratified
  by age group, sex, and race/ethnicity.</p>n\",\n\t\"license_title\": \"Other License
